if not hasattr(x, 'shape'):
    return x
if len(x.shape) == 4:
    x = np.transpose(x, [0, 3, 1, 2])
    return np.expand_dims(x, axis=0)
elif len(x.shape) == 3:
    return np.transpose(x, [2, 0, 1])
elif len(x.shape) == 2:
    if is_sequence:
        return x.reshape(x.shape[::-1] + (1,))
    else:
        return x.reshape((1,) + x.shape)
elif len(x.shape) == 1:
    if is_sequence:
        return x.reshape((x.shape[0], 1, 1, 1, 1))
    else:
        return x
else:
    return x
